import react from "react";
import "../style.css"

const Home = () => {
    return (
        <div className="posts">
            <h1 className="home-header">Welcome to Stranger's Things!</h1>
            <p className="home-message">This is a website of classified ads and community notices that serves an urban area. Listings are free, but job and rental postings in major cities are paid.</p>
            <p className="home-message">Please login or register to be able to create posts and message other users!</p>


        </div>
    )
}
export default Home
